  true,\n\t\"url\": null,\n\t\"notes\": \"See the Vehicle Infrastructure Initiative
  Proof of Concept data environment for a description of the Michigan Test Bed and
  the data collected there in 2008. In April 2009 a second set of trials was conducted
  at the Michigan Test Bed, directed by the National Center for Atmospheric Research
  (NCAR). These trials used a smaller set of vehicles, and concentrated on collecting
  data during periods of rainy or snowy weather. RSE data for the the NCAR 2009 tests
  were available for nine days in April 2009. The data in this data environment consists
  of RSE and OBE data for the six days with the most good data.\",\n\t\"license_title\":
